import React, { useEffect, useState } from 'react';  
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';  
import Home from './components/Home';  
import Winners from './components/Winners';  
import PastWinners from './components/PastWinners';  
import Navbar from './components/Navbar';  
import Footer from './components/Footer';  
import WalletConnect from './components/WalletConnect'; // Import WalletConnect  

function App() {  
  const [timeLeft, setTimeLeft] = useState({  
    days: 0,  
    hours: 0,  
    minutes: 0,  
    seconds: 0  
  });  

  const [walletAddress, setWalletAddress] = useState('');  

  useEffect(() => {  
    const nextDrawDate = new Date('2024-12-31');  

    const timer = setInterval(() => {  
      const now = new Date();  
      const difference = nextDrawDate - now;  

      if (difference < 0) {  
        clearInterval(timer);  
        setTimeLeft({ days: 0, hours: 0, minutes: 0, seconds: 0 });  
        return;  
      }  

      const days = Math.floor(difference / (1000 * 60 * 60 * 24));  
      const hours = Math.floor((difference / (1000 * 60 * 60)) % 24);  
      const minutes = Math.floor((difference / 1000 / 60) % 60);  
      const seconds = Math.floor((difference / 1000) % 60);  

      setTimeLeft({ days, hours, minutes, seconds });  
    }, 1000);  

    return () => clearInterval(timer);  
  }, []);  

  const handleConnect = (address) => {  
    setWalletAddress(address);  
  };  

  return (  
    <Router>  
      <div className="min-h-screen bg-gradient-to-r from-purple-400 to-blue-500 p-4" style={{ fontFamily: 'Bubblegum Sans, cursive' }}>  
        <div className="max-w-4xl mx-auto bg-white rounded-lg shadow-lg overflow-hidden">  
          <Navbar />  
          <WalletConnect onConnect={handleConnect} /> {/* Add WalletConnect component */}  
          <main className="p-8 text-center">  
            <h1 className="text-5xl font-bold mb-6 text-white drop-shadow-lg">  
              Monthly NFT Rewards Program üéâ  
            </h1>  

            {/* Button-Style Countdown Box */}  
            <div className="bg-white rounded-lg shadow-lg p-6 mb-8 mx-auto max-w-2xl">  
              <h2 className="text-4xl font-bold mb-4 text-purple-800">Next Draw In:</h2>  
              <button className="bg-purple-600 text-white font-bold py-2 px-4 rounded-lg shadow-md hover:bg-purple-700 transition duration-300">  
                {`${timeLeft.days} Days ${timeLeft.hours} Hours ${timeLeft.minutes} Minutes ${timeLeft.seconds} Seconds`}  
              </button>  
            </div>  

            {/* Added Disclaimer Box */}  
            <div className="bg-yellow-50 border-2 border-yellow-200 rounded-lg p-4 mb-8 mx-auto max-w-2xl">  
              <p className="text-yellow-800 font-medium">  
                ‚ö†Ô∏è Please Note: The actual reward amounts will be proportional to the number of NFTs sold.  
              </p>  
            </div>  

            <div className="mb-8">  
              <h2 className="text-3xl font-bold mb-4 text-purple-800">Monthly Prize Pool: \$3,750 üèÜ</h2>  
              <div className="space-y-2">  
                <p>üêº üèÜ Grand Prize: \$1,500</p>  
                <p>üêº üèÜ Second Prize: \$1,000</p>  
                <p>üêº üèÜ Third Prize: \$750</p>  
                <p>üêº üèÜ Fourth Prize: \$300</p>  
                <p>üêº üèÜ Fifth Prize: \$200</p>  
              </div>  
            </div>  

            <div className="mb-8">  
              <h2 className="text-3xl font-bold mb-4 text-purple-800">How It Works üéØ</h2>  
              <div className="space-y-2">  
                <p>Every month, 10 lucky NFT holders will be randomly selected</p>  
                <p>Odds of winning Grand Prize: 1 in 10,000</p>  
                <p>Odds of winning Second Prize: 1 in 10,000</p>  
                <p>Odds of winning Third Prize: 1 in 10,000</p>  
                <p>Odds of winning Fourth Prize: 1 in 10,000</p>  
                <p>Odds of winning Fifth Prize: 1 in 10,000</p>  
                <p>Winners have 14 days to claim their prizes</p>  
                <p>Unclaimed prizes will be added to next month's drawing</p>  
              </div>  
            </div>  

            <div className="mb-8">  
              <h2 className="text-3xl font-bold mb-4 text-purple-800">Prize Distribution üí∞</h2>  
              <div className="text-center">  
                For each prize won:  
                <div className="space-y-2 mt-2">  
                  <p>50% will be added to the winning NFT's liquidity</p>  
                  <p>50% will be airdropped to the winning wallet in stablecoin</p>  
                </div>  
              </div>  
            </div>  
          </main>  
          <Routes>  
            <Route path="/" element={<Home />} />  
            <Route path="/winners" element={<Winners />} />  
            <Route path="/past-winners" element={<PastWinners />} />  
          </Routes>  
          <Footer />  
        </div>  
      </div>  
    </Router>  
  );  
}  

export default App;
